import React from 'react';
import "./Headercss.css"

function Header() {
  return (
    <header>
      <div className="logo">
        <a className='main scale' href="/">Jemos</a>
      </div>
      <div className="search-bar">
        <input type="text" placeholder="Поиск..." />
        <button type="submit">Поиск</button>
      </div>
      <div>
        <a className='info scale' href='/info'> О нас</a>
      </div>
      <div className="register">
        <a className="reg scale" href='/register' >Регистрация</a>
      </div>
    </header>
  );
}

export default Header;
